import axios from 'axios';
import { API } from '../Constants';

export function CheckAuth(name, password) {

  axios({
    method: 'POST',
    baseURL: API + 'signin',
    data: {
      name: name,
      password: password
    }
  })
}

export function Rsvp(rsvp, setServerError, setNoEmail) {

  if (rsvp.email === '') setNoEmail(true);
  else {
    axios({
      method: 'POST',
      baseURL: API + 'rsvp',
      data: {
        name: rsvp.name,
        response: rsvp.response,
        text: rsvp.text,
        email: rsvp.email
      }
    }).catch((err) => {
      console.log(err);
      setServerError(true);
    })
  }
}

